{"operationName":"blogPosts","variables":{"id":"101231710100626389","first":4,"after":null},"query":"query blogPosts($id: ID!, $first: Int, $after: String) {
  company(id: $id) {
    id
    blogPosts(first: $first, after: $after) {
      count
      edges {
        node {
          id
          imageUrl
          url
          title
          author
          publishedAt
          services {
            ...serviceFields
            __typename
          }
          __typename
        }
        __typename
      }
      pageInfo {
        endCursor
        hasNextPage
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment serviceFields on Tool {
  id
  name
  slug
  title
  verified
  imageUrl
  canonicalUrl
  path
  votes
  fans
  stacks
  following
  followContext
  __typename
}
"}
